sources.sass/_grid.scss:
$columns: 12!default;


@mixin gridItems($screenType: 'cols'){
    @for $i from 1 through $columns{
        .#{$screenType}-#{$i}{
        width: $i / $columns * 100%;
        min-height: 1px;
        padding: 0 10px;
        img{
            width: 100%;
        }
        }
    }
};

@mixin rowItems($screenType: 'splitrow'){
    @for $i from 1 through $columns{
        .#{$screenType}-#{$i}{
        width: $i / $columns * 100%;
        position: relative;
        display: flex;
        flex-wrap: wrap;
        overflow: hidden;
        }
    }
}

@mixin flexPosition($screenType: ''){
    .flexCenter#{$screenType}{
        justify-content: center;
    }
    .flexAround#{$screenType}{
        justify-content: space-around;
    }
    .flexBetween#{$screenType}{
        justify-content: space-between;
    }
    .flexEvenly#{$screenType}{
        justify-content: space-evenly;
    }
    .flexEnd#{$screenType}{
        justify-content: flex-end;
    }
    .flexStart#{$screenType}{
        justify-content: flex-start;
    }
    .flexVaCenter#{$screenType}{
        align-items: center;
    }
    .flexVaEnd#{$screenType}{
        align-items: flex-end;
    }
    .flexVaStart#{$screenType}{
        align-items: flex-start;
    }
    .selfStart#{$screenType}{
        justify-self: start;
        margin-left: 0;
        margin-right: auto;
    }
    .selfEnd#{$screenType}{
        justify-self: end;
        margin-left: auto;
        margin-right: 0;
    }

}


@include gridItems();

@include rowItems();

@include flexPosition();

.rows{
    position: relative;
    display: flex;
    flex-wrap: wrap;
}



@media only screen and (min-width: 640px) {
    @include gridItems('csm');
    @include rowItems('splitrowM');
    @include flexPosition('M');
};

@media only screen and (min-width: 1080px) {
    @include gridItems('csl');
    @include rowItems('splitrowL');
    @include flexPosition('L');
};

sources.sass/_bouton.scss:
$primaryColor: rgb(60, 100, 225);
$neonLight: 0 0 2px rgba(202,228,225,0.92),
0 0 10px rgba(202,228,225,0.34),
0 0 4px rgba(30,132,242,0.52),
0 0 7px rgba(30,132,242,0.92),
0 0 11px rgba(30,132,242,0.78),
0 0 16px rgba(30,132,242,0.92);


@mixin btnBorderAnimeConfig($btnName, $btnWidth, $btnHeight, $borderColor, $primaryBackgound, $hoverBackground, $textDefaultColor, $textHoverColor) {
    .#{$btnName}{
        font-family: Arial, Helvetica, sans-serif;
        position: relative;
        text-align: center;
        width: $btnWidth;
        height: $btnHeight;
        line-height: $btnHeight;
        border-radius: 5px;
        background-color: $primaryBackgound;
        color: $textDefaultColor;
        box-shadow:2px 2px 2px gray,
        -1px -1px 2px white;
        font-size: $btnHeight / 2;
        font-weight: bold;

        span:before{
            content: '';
            position: absolute;
            bottom: 0;
            left: 0;
            width: 2px;
            height: 2px;
        }

        span:after{
            content: '';
            position: absolute;
            top: 0;
            right: 0;
            width: 2px;
            height: 2px;
        }


    }
    .#{$btnName}:hover{
        background-color: $hoverBackground;
        color: $textHoverColor;
        box-shadow: $neonLight;
        transition: ease-out 0.2s;

        span:before{
            z-index: 99;
            border-bottom: solid 2px $borderColor;
            border-left: solid 2px $borderColor;
            border-radius: 5px;
            width: calc(100% - 2px);
            height: calc(100% - 2px);
            transition: ease-out 0.4s, width 0.25s, height 0.15s, ease-out 0.3s;
        }
        span:after{
            z-index: 100;
            border-top: solid 2px $borderColor;
            border-right: solid 2px $borderColor;
            border-radius: 5px;
            width: calc(100% - 2px);
            height: calc(100% - 2px);
            transition: ease-out 0.4s, width 0.25s, height 0.15s, ease-out 0.3s;
        }
    }
}

@include btnBorderAnimeConfig('btn',75px ,30px ,$primaryColor , $primaryColor ,white, white, black);

